import React from "react";
import PostService from "../Shared/PostService";

export default function Posts() {
  return (
    <div style={{ border: "2px solid red", height: "100vh" }}>
      <input
        style={{
          border: "1px solid grey",
          height: "15vh",
          position: "sticky",
          top: "75px",
        }}
      ></input>
    </div>
  );
}
